import React from 'react'
import axios from 'axios';
import { useLoaderData } from 'react-router';
// import { request } from 'http';

interface Brewery {
  id: string;
  name: string;
  brewery_type: string;
  address_1?: string | null;
  address_2?: string | null;
  address_3?: null;
  city: string;
  state_province: string;
  postal_code: string;
  country: string;
  longitude?: string | null;
  latitude?: string | null;
  phone?: string | null;
  website_url?: string | null;
  state: string;
  street?: string | null;
}

const Breweries = () => {
    const breweries: Brewery[] | any = useLoaderData();

    return (
        <div>Breweries
            {breweries.map(brewery => {
                <p key={brewery.id}>{brewery.name}</p>
            })}
        </div>
    )
}

export default Breweries

export const breweriesLoader = async (url: string) => {
    try {
        const response = await axios.get('https://api.openbrewerydb.org/v1/breweries');
        console.log(response.data.results);
        return response.data.results;
    } catch (error: any) {
        if (axios.isAxiosError(error) && error.response) {
            console.log(error.response.status);
            console.log(error.response.statusText);
            console.log(error.response.data.results);
        } else if (axios.isAxiosError(error) && error.request) {
            console.log(error.request.status);
            console.log(error.request.statusText);
            console.log(error.request.data.results);
        } else {
            console.log('Error', error.message);
        }
    }
}
